import './App.css';
import { Login, ProtectedRoute, Dashboard, Contact, Blog } from './Components';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import React from 'react';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/'>
          <ProtectedRoute></ProtectedRoute>
        </Route>
        <Route path='/login'>
          <Login></Login>
        </Route>

      </Routes>
    </BrowserRouter>

  );
}

export default App;
